1. **Use `@type-guard` Annotation:**
   TypeScript supports type guards using the `@type-guard` annotation. This allows you to define what the TypeScript compiler believes to be a "safe" or "undefined" type.

```typescript
@type-guard
function myFunction(value: aValue) {
  // Type checking logic
  return value as aValue;
}

// This will pass the type check because 'aB' is considered as 'undefined'
// and thus the safe value can be converted to 'undefined'
