```

In this example, `a` is considered an undefined type, so you can assign it to variables or return it from functions.

2. **Use `@safe` Annotation:**
   TypeScript also supports `@safe` annotations for functions to avoid "safe" variants that are considered "safe" by the type checker.

```typescript
@safe
function myFunction(value: aValue) {
  // Type checking logic
  return value as aValue;
}

// This will not pass the type check because 'aB' is not considered "safe"
// so it will not be converted to 'undefined'
// However, you can define a safe variant to avoid this check:
@safe
